/*Table structure for table `assets_detail` */

DROP TABLE IF EXISTS `assets_detail`;

CREATE TABLE `assets_detail`
(
    `id`                  bigint(20) NOT NULL auto_increment COMMENT '自增ID',
    `assets_type_id`      bigint(20)   default NULL COMMENT '物资类别ID',
    `warehouse_id`        bigint(20)   default NULL COMMENT '仓库ID',
    `point_type`          char(1)      default NULL COMMENT '入库点位类型(0：货架、1：智能柜)',
    `point_id`            bigint(20)   default NULL COMMENT '点位编号（货架ID或智能柜ID）',
    `position_num`        int(10)      default NULL COMMENT '位置编号（货架层号或智能柜格位编号）',
    `current_count`       int(10)      default NULL COMMENT '当前库存',
    `history_total_count` int(10)      default NULL COMMENT '历史总库存',
    `create_time`         datetime     default NULL COMMENT '创建时间',
    `create_by`           varchar(50)  default NULL COMMENT '创建人',
    `update_time`         datetime     default NULL COMMENT '更新时间',
    `update_by`           varchar(50)  default NULL COMMENT '更新人',
    `remark`              varchar(200) default NULL COMMENT '备注',
    `stock_status`        char(1)      default NULL COMMENT '库存状态（0：离库、1：在库、2：报废）',
    `police_id`           bigint(20)   default NULL COMMENT '所属人员ID',
    PRIMARY KEY (`id`),
    KEY `police_id` (`police_id`),
    CONSTRAINT `assets_detail_ibfk_1` FOREIGN KEY (`police_id`) REFERENCES `sc_police_person` (`police_id`) ON DELETE CASCADE
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='物资详情表';

