/*Table structure for table `assets_info` */

DROP TABLE IF EXISTS `assets_info`;

CREATE TABLE `assets_info`
(
    `assets_id`     bigint(20) NOT NULL auto_increment COMMENT '物资id',
    `type_id`       bigint(20)   default NULL COMMENT '类别id（二级）',
    `warehouse_id`  bigint(20)   default NULL COMMENT '仓库id',
    `total_money`   double       default '0' COMMENT '在库金额',
    `usable_count`  int(20)      default '0' COMMENT '可用库存',
    `all_count`     int(50)      default '0' COMMENT '总库存（历史累加数量）',
    `latestPrice`   double       default '0' COMMENT '最新单价',
    `average_price` double       default '0' COMMENT '平均单价',
    `update_time`   datetime     default NULL COMMENT '更新时间',
    `status`        char(1)      default NULL COMMENT '状态(0=待入库,1=在库,2=借出,3=报废,4=维修中,5=遗失)',
    `create_time`   datetime     default NULL COMMENT '创建时间',
    `assets_code`   varchar(255) default NULL COMMENT '物资条码',
    `reserve1`      varchar(255) default NULL COMMENT '预留',
    `operator`      varchar(100) default NULL COMMENT '操作者',
    `reserve2`      varchar(255) default NULL COMMENT '预留',
    `reserve3`      varchar(255) default NULL COMMENT '预留',
    `supplier_id`   bigint(20)   default NULL COMMENT '品牌（供应商id）',
    `assets_name`   varchar(100) default NULL COMMENT '名称',
    `assets_model`  varchar(255) default NULL COMMENT '规格（手动填）',
    `type_name`     varchar(50)  default NULL COMMENT '物资类别（暂时没用）',
    `price`         double       default '0' COMMENT '单价',
    `shelves_id`    bigint(10)   default NULL COMMENT '货架ID',
    PRIMARY KEY (`assets_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='物资详情表';

