/*Table structure for table `assets_out_record` */

DROP TABLE IF EXISTS `assets_out_record`;

CREATE TABLE `assets_out_record`
(
    `id`           bigint(20) NOT NULL auto_increment,
    `assets_no`    varchar(255) default NULL COMMENT '物资编号',
    `assets_name`  varchar(255) default NULL COMMENT '物资名称',
    `assets_type`  varchar(255) default NULL COMMENT '物资类别',
    `supplier`     varchar(255) default NULL COMMENT '品牌',
    `model`        varchar(255) default NULL COMMENT '规格',
    `usedTo`       varchar(255) default NULL COMMENT '用途',
    `number`       varchar(255) default NULL COMMENT '数量',
    `price`        double       default NULL COMMENT '单价',
    `money`        double       default NULL COMMENT '金额',
    `receive`      varchar(255) default NULL COMMENT '接收人',
    `phone`        varchar(20)  default NULL COMMENT '手机号',
    `create_time`  datetime     default NULL COMMENT '出库时间',
    `operator`     varchar(255) default NULL COMMENT '操作人',
    `warehouse`    varchar(255) default NULL COMMENT '所在仓库',
    `warehouse_id` bigint(20)   default NULL COMMENT '仓库id',
    `reserve1`     varchar(255) default NULL,
    `reserve2`     varchar(255) default NULL,
    `reserve3`     varchar(255) default NULL,
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='物资出库记录(废弃)';

