/*Table structure for table `ding_dept` */

DROP TABLE IF EXISTS `ding_dept`;

CREATE TABLE `ding_dept`
(
    `id`                       bigint(20) NOT NULL auto_increment COMMENT '自增主键',
    `dept_id`                  bigint(20)   default NULL COMMENT '部门ID',
    `name`                     varchar(50)  default NULL COMMENT '部门名称',
    `parent_id`                bigint(20)   default NULL COMMENT '父部门ID',
    `source_identifier`        varchar(50)  default NULL COMMENT '部门标识字段',
    `create_dept_group`        tinyint(1)   default NULL COMMENT '是否同步创建一个关联此部门的企业群（true:创建，false:不创建）',
    `auto_add_user`            tinyint(1)   default NULL COMMENT '当部门群已经创建后，是否有新人加入部门会自动加入该群：(true：自动加入群,false：不会自动加入群)',
    `auto_approve_apply`       tinyint(1)   default NULL COMMENT '是否默认同意加入该部门的申请(true：表示加入该部门的申请将默认同意,false：表示加入该部门的申请需要有权限的管理员同意)',
    `from_union_org`           tinyint(1)   default NULL COMMENT '部门是否来自关联组织(true：是，false：不是)',
    `tags`                     varchar(10)  default NULL COMMENT '教育部门标签(campus：校区、period：学段、grade：年级、class：班级)',
    `order`                    int(10)      default NULL COMMENT '在父部门中的次序值。',
    `dept_group_chat_id`       varchar(50)  default NULL COMMENT '部门群ID',
    `group_contain_sub_dept`   tinyint(1)   default NULL COMMENT '部门群是否包含子部门(true：包含,false：不包含)',
    `org_dept_owner`           varchar(50)  default NULL COMMENT '企业群群主userId',
    `dept_manager_userid_list` varchar(300) default NULL COMMENT '部门的主管userd列表。',
    `outer_dept`               tinyint(1)   default NULL COMMENT '是否限制本部门成员查看通讯录(true：开启限制。开启后本部门成员只能看到指定部门/人的通讯录,false：不限制)',
    `outer_permit_depts`       varchar(300) default NULL COMMENT '配置的部门员工可见部门Id列表(限制本部门成员查看通讯录（即outer_dept为true）：outer_permit_depts表示设置的只能看到指定部门/人的部门Id列表、未限制本部门成员查看通讯录（即outer_dept为false）：调用接口不返回outer_permit_depts字段)',
    `outer_permit_users`       varchar(300) default NULL COMMENT '配置的部门员工可见员工userId列表(限制本部门成员查看通讯录（即outer_dept为true）：outer_permit_users表示设置的只能看到指定部门/人的员工userId列表、未限制本部门成员查看通讯录（即outer_dept为false）：调用接口不返回outer_permit_users字段)',
    `hide_dept`                tinyint(1)   default NULL COMMENT '是否开启隐藏本部门(true：开启隐藏本部门。可以设置隐藏范围，如设置向所有人和部门隐藏，或者允许指定部门/人可见、false：关闭隐藏本部门，即部门在公司通讯录显示)',
    `user_permits`             varchar(300) default NULL COMMENT '隐藏部门的员工userId列表(开启隐藏本部门（即hide_dept为true）：user_permits表示设置的允许指定部门/人可见的员工userId列表、未开启隐藏本部门（即hide_dept为false）：调用接口不返回user_permits字段)',
    `dept_permits`             varchar(300) default NULL COMMENT '隐藏部门的部门Id列表(开启隐藏本部门（即hide_dept为true）：dept_permits表示设置的允许指定部门/人可见的部门Id列表、未开启隐藏本部门（即hide_dept为false）：调用接口不返回dept_permits字段)',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='钉钉部门信息表';

