/*Table structure for table `ding_user` */

DROP TABLE IF EXISTS `ding_user`;

CREATE TABLE `ding_user`
(
    `id`                bigint(20) NOT NULL auto_increment COMMENT '自增ID',
    `userid`            varchar(50)  default NULL COMMENT '员工的userId',
    `unionid`           varchar(100) default NULL COMMENT '员工在当前开发者企业账号范围内的唯一标识',
    `name`              varchar(20)  default NULL COMMENT '员工姓名',
    `avatar`            varchar(100) default NULL COMMENT '头像',
    `state_code`        varchar(20)  default NULL COMMENT '国际电话区号',
    `manager_userid`    varchar(50)  default NULL COMMENT '员工的直属主管',
    `mobile`            varchar(20)  default NULL COMMENT '手机号码',
    `hide_mobile`       tinyint(1)   default NULL COMMENT '是否号码隐藏(true：隐藏,false：不隐藏)',
    `telephone`         varchar(30)  default NULL COMMENT '分机号',
    `job_number`        varchar(20)  default NULL COMMENT '员工工号',
    `title`             varchar(20)  default NULL COMMENT '职位',
    `email`             varchar(30)  default NULL COMMENT '员工邮箱',
    `work_place`        varchar(30)  default NULL COMMENT '办公地点',
    `remark`            varchar(100) default NULL COMMENT '备注',
    `exclusive_account` tinyint(1)   default NULL COMMENT '是否为企业账号(true：是,false：不是)',
    `org_email`         varchar(30)  default NULL COMMENT '员工的企业邮箱(如果员工的企业邮箱没有开通，返回信息中不包含该数据。)',
    `dept_id_list`      varchar(50)  default NULL COMMENT '所属部门id列表',
    `dept_order_list`   varchar(100) default NULL COMMENT '员工在对应的部门中的排序',
    `extension`         varchar(500) default NULL COMMENT '扩展属性，最大长度2000个字符',
    `hired_date`        varchar(30)  default NULL COMMENT '入职时间，Unix时间戳，单位毫秒',
    `active`            tinyint(1)   default NULL COMMENT '是否激活了钉钉(true：已激活,false：未激活)',
    `real_authed`       tinyint(1)   default NULL COMMENT '是否完成了实名认证(true：已认证,false：未认证)',
    `senior`            tinyint(1)   default NULL COMMENT '是否为企业的高管(true：是,false：不是)',
    `admin`             tinyint(1)   default NULL COMMENT '是否为企业的管理员(true：是,false：不是)',
    `boss`              tinyint(1)   default NULL COMMENT '是否为企业的老板(true：是,false：不是)',
    `leader_in_dept`    varchar(100) default NULL COMMENT '员工所在部门信息及是否是领导(员工所在部门的部门ID、员工在对应的部门中是否是领导(true：是,false：不是))',
    `role_list`         varchar(300) default NULL COMMENT '角色列表(角色ID、角色名称、角色组名称)',
    `union_emp_ext`     varchar(500) default NULL COMMENT '当用户来自于关联组织时的关联信息(员工id的userId、关联映射关系、当前用户所属的组织的企业corpId)',
    `face_img_path`     varchar(100) default NULL COMMENT '人脸图片路径',
    `account`           varchar(50)  default NULL COMMENT '终端账号',
    `password`          varchar(50)  default NULL COMMENT '终端密码',
    `ic_card_no`        varchar(50)  default NULL COMMENT '终端IC卡号',
    `role`              char(1)      default '0' COMMENT '终端角色 0:普通用户 1:管理员',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8;

