/*Table structure for table `evidence_analysis` */

DROP TABLE IF EXISTS `evidence_analysis`;

CREATE TABLE `evidence_analysis`
(
    `id`            bigint(20) NOT NULL auto_increment,
    `evidence_id`   varchar(20)   default NULL COMMENT '物证编号',
