/*Table structure for table `evidence_info` */

DROP TABLE IF EXISTS `evidence_info`;

CREATE TABLE `evidence_info`
(
    `id`                  bigint(20) NOT NULL auto_increment COMMENT 'id',
    `evidence_id`         varchar(20)  default NULL COMMENT '物证编号',
    `evidence_name`       varchar(30)  default NULL COMMENT '物证名称',
    `evidence_type`       bigint(20)   default NULL COMMENT '物证类别',
    `img_path`            varchar(255) default NULL COMMENT '物证图片路径',
    `evidence_status`     char(1)      default '0' COMMENT '状态(0=待入库,1=在库,2=出库,3=送检)',
    `case_id`             varchar(20)  default NULL COMMENT '所属案件Id',
    `cabinet_id`          varchar(20)  default NULL COMMENT '所属物证柜Id',
    `cabinet_num`         int(10)      default NULL COMMENT '所属柜位',
    `cabinet_small`       int(10)      default NULL COMMENT '所属小柜位',
    `suspect_id`          varchar(20)  default NULL COMMENT '嫌疑人身份证号',
    `suspect_name`        varchar(30)  default NULL COMMENT '嫌疑人姓名',
    `person_id`           varchar(20)  default NULL COMMENT '案件经办人Id',
    `dept_id`             varchar(20)  default NULL COMMENT '部门Id',
    `evidence_createtime` date         default NULL,
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8;

