/*Table structure for table `sc_dev` */

DROP TABLE IF EXISTS `sc_dev`;

CREATE TABLE `sc_dev`
(
    `id`           bigint(20) NOT NULL auto_increment COMMENT '自增主键',
    `warehouse_id` bigint(20)   default NULL COMMENT '所属仓库ID',
    `dev_sn`       varchar(20)  default NULL COMMENT '设备序列号',
    `dev_name`     varchar(50)  default NULL COMMENT '设备名称',
    `dev_ip`       varchar(20)  default NULL COMMENT '设备IP',
    `cell_total`   int(10)      default NULL COMMENT '总柜位数',
    `status`       char(1)      default '1' COMMENT '在线状态(0代表在线 1代表离线)',
    `type`         char(1)      default '0' COMMENT '设备类型(0代表主柜 1代表主副柜)',
    `version`      varchar(20)  default NULL COMMENT '软件版本',
    `connTime`     datetime     default NULL COMMENT '最后心跳时间',
    `remark`       varchar(200) default NULL COMMENT '备注',
    `create_time`  datetime     default NULL COMMENT '创建时间',
    `create_by`    varchar(50)  default NULL COMMENT '创建人',
    `update_time`  datetime     default NULL COMMENT '更新时间',
    `update_by`    varchar(50)  default NULL COMMENT '更新人',
    `mode`         char(1)      default NULL COMMENT '使用模式（0：专人专柜，1：一柜多人）',
    PRIMARY KEY (`id`),
    UNIQUE KEY `dev_sn_2` (`dev_sn`),
    KEY `dev_sn` (`dev_sn`),
    KEY `warehouse_id` (`warehouse_id`),
    CONSTRAINT `sc_dev_ibfk_1` FOREIGN KEY (`warehouse_id`) REFERENCES `assets_warehouse` (`warehouse_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='装备柜信息表';

