/*Table structure for table `sc_person_info` */

DROP TABLE IF EXISTS `sc_person_info`;

CREATE TABLE `sc_person_info`
(
    `id`           bigint(20) NOT NULL auto_increment,
    `person_id`    varchar(50)  default NULL COMMENT '人员ID',
    `person_name`  varchar(30)  default NULL COMMENT '人员名称',
    `person_type`  char(1)      default NULL COMMENT '人员类型（0--管理员,1--普通用户）',
    `img_path`     varchar(255) default NULL COMMENT '人员图片保存路径',
    `tel_phone`    varchar(20)  default NULL COMMENT '联系方式',
    `created_time` datetime     default NULL COMMENT '创建时间',
    `updated_time` datetime     default NULL COMMENT '更新时间',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8;

