/*Table structure for table `sc_police_cell_person` */

DROP TABLE IF EXISTS `sc_police_cell_person`;

CREATE TABLE `sc_police_cell_person`
(
    `cell_link_id` bigint(20) NOT NULL auto_increment COMMENT '智能柜格位与人员关联ID',
    `dev_sn`       varchar(255) default NULL COMMENT '装备柜设备序列号',
    `cell_id`      int(11)      default NULL COMMENT '格位编号',
    `police_id`    bigint(20)   default NULL COMMENT '装备柜人员ID(平台自增ID)',
    `created_time` datetime     default NULL COMMENT '创建时间',
    `person_type`  char(1)      default NULL COMMENT '人员类型（0--管理员,1--普通用户）',
    PRIMARY KEY (`cell_link_id`),
    KEY `sc_police_cell_person_ibfk_1` (`dev_sn`),
    KEY `sc_police_cell_person_ibfk_2` (`police_id`),
    CONSTRAINT `sc_police_cell_person_ibfk_1` FOREIGN KEY (`dev_sn`) REFERENCES `sc_dev` (`dev_sn`) ON DELETE CASCADE,
    CONSTRAINT `sc_police_cell_person_ibfk_2` FOREIGN KEY (`police_id`) REFERENCES `sc_police_person` (`police_id`) ON DELETE CASCADE
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='装备柜格位人员关联表';

/*Data for the table `sc_police_cell_person` */

/*Table structure for table `sc_police_person` */

DROP TABLE IF EXISTS `sc_police_person`;

CREATE TABLE `sc_police_person`
(
    `police_id`       bigint(20) NOT NULL auto_increment COMMENT '人员ID',
    `android_id`      varchar(50)  default NULL COMMENT '终端数据表ID(存在不同终端，可重复)',
    `person_id`       varchar(50)  default NULL COMMENT '人员ID(在同一台设备唯一)',
    `face_id`         varchar(50)  default NULL COMMENT '人脸ID(在同一台设备唯一)',
    `img_path`        varchar(200) default NULL COMMENT '人脸图片保存路径',
    `img_upload_time` datetime     default NULL COMMENT '人员图片上传时间',
    `person_type`     char(1)      default NULL COMMENT '人员类型（0--管理员,1--普通用户）',
    `person_name`     varchar(50)  default NULL COMMENT '人员姓名',
    `account`         varchar(50)  default NULL COMMENT '账号',
    `password`        varchar(50)  default NULL COMMENT '密码',
    `tel_phone`       varchar(20)  default NULL COMMENT '联系方式',
    `card_no`         varchar(20)  default NULL COMMENT '卡号',
    `dev_sn`          varchar(20)  default NULL COMMENT '所属设备的设备序列号',
    `created_time`    datetime     default NULL COMMENT '创建时间',
    `updated_time`    datetime     default NULL COMMENT '更新时间',
    PRIMARY KEY (`police_id`),
    KEY `person_id` (`person_id`),
    KEY `dev_sn` (`dev_sn`),
    CONSTRAINT `sc_police_person_ibfk_1` FOREIGN KEY (`dev_sn`) REFERENCES `sc_dev` (`dev_sn`) ON DELETE CASCADE
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='装备柜人员信息表';

/*Data for the table `sc_police_person` */

/*Table structure for table `sc_police_reader` */

DROP TABLE IF EXISTS `sc_police_reader`;

CREATE TABLE `sc_police_reader`
(
    `reader_id`       bigint(20) NOT NULL auto_increment COMMENT '阅读器自增Id',
    `device_id`       varchar(50)  default NULL COMMENT '设备编号',
    `serial_path`     varchar(50)  default NULL COMMENT '串口',
    `serial_baudRate` int(11)      default NULL COMMENT '波特率',
    `status`          char(1)      default '0' COMMENT '状态(0：关闭、1：打开)',
    `version`         varchar(100) default NULL COMMENT '设备版本',
    `create_by`       varchar(100) default NULL COMMENT '创建人',
    `create_time`     datetime     default NULL COMMENT '创建时间',
    `update_by`       varchar(100) default NULL COMMENT '更新人',
    `update_time`     datetime     default NULL COMMENT '更新时间',
    `remark`          varchar(200) default NULL,
    PRIMARY KEY (`reader_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='RFID阅读器信息表';

