DROP TABLE IF EXISTS `sc_police_sync`;

CREATE TABLE `sc_police_sync`
(
    `sync_id`   bigint(20)  NOT NULL auto_increment,
    `action`    varchar(50) NOT NULL COMMENT '消息类型',
    `dev_id`    bigint(20) default NULL COMMENT '设备ID',
    `police_id` bigint(20) default NULL COMMENT '人员ID',
    PRIMARY KEY (`sync_id`),
    KEY `dev_id` (`dev_id`),
