/*Table structure for table `sc_record_alarm` */

DROP TABLE IF EXISTS `sc_record_alarm`;

CREATE TABLE `sc_record_alarm`
(
    `id`           bigint(20) NOT NULL auto_increment COMMENT '自增主键',
    `dev_id`       bigint(20)  default NULL COMMENT '报警智能柜ID',
    `dev_sn`       varchar(20) default NULL COMMENT '报警智能柜序列号',
    `dev_name`     varchar(50) default NULL COMMENT '报警智能柜名称',
    `cell_id`      int(10)     default NULL COMMENT '报警格位编号',
    `warehouse_id` bigint(20)  default NULL COMMENT '仓库Id',
    `w_name`       varchar(50) default NULL COMMENT '仓库名称',
    `alarm_type`   char(1)     default NULL COMMENT '报警类型 0:开门超时报警',
    `alarm_time`   datetime    default NULL COMMENT '报警报警时间',
    `create_time`  datetime    default NULL COMMENT '创建时间',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='装备柜报警记录';

